import React from "react";
import "./Toggler.css";

function Toggler({ toggle }) {
  return (
    <div
      style={{
        display: toggle ? "flex" : "none",
        width: "1000px",
        height: "100vh",
        backgroundColor: "white",
      }}
      className="theToggler"
    ></div>
  );
}

export default Toggler;
